  "text" : "(\uACC4\uC18D2) \uC804\uD22C\uC801\uC73C\uB85C \uB17C\uC7C1\uD558\uC9C4 \uC54A\uC744 \uC0DD\uAC01\uC774\uB2E4. \uAD8C\uB9AC, \uC758\uBB34, \uC5F0\uB300\uC5D0 \uB300\uD574 \uC62C\uAC00\uBBF8\uB97C \uC50C\uC6CC\uC11C \uB2E4\uB918\uB358 \uBC29\uC2DD\uC5D0\uB294 \uC88C\uD30C\uC801\uC815\uC758, \uC0AC\uD68C\uACC4\uC57D\uB860\uC774 \uC9C0 \uBA4B\uB300\uACE0 \uBB49\uCCD0\uC788\uB2E4. \uC548\uB07C\uB294 \uAC8C \uC0C1\uCC45. \n\uC5B4\uCC0C\uB410\uAC74 \uC591\uC131\uD3C9\uB4F1\uACFC \uD398\uBBF8\uB2C8\uC998, \uD398\uBBF8\uB2C8\uC2A4\uD2B8\uAC00 \uB0A8, \uB0A8\uC77C\uC774\uB77C \uC0DD\uAC01\uD558\uC9C0 \uC54A\uACE0 \uBCF4\uB828\uB2E4.",
