  "text" : "(\uACC4\uC18D1) \u201C\uB098\uB294 \uD398\uBBF8\uB2C8\uC2A4\uD2B8\uB2E4\u201D\uB294 \uC5B4\uB5A4 \uC758\uBBF8\uC77C\uAE4C \uC0DD\uAC01\uD574\uBD24\uB2E4. \uC0C8\uB85C\uC6B4 \uBC29\uC2DD\uC758 \uC6B4\uB3D9\uC77C\uAE4C? \uB9DE\uAE30\uB3C4 \uD558\uACE0 \uC544\uB2C8\uAE30\uB3C4 \uD55C \uAC83 \uAC19\uB2E4. \uB2E4\uB9CC \u201C\uAE85\u201D\uC758 \uC9D1\uACB0\uC744 \uB118\uC5B4 \uC815\uB3C8\uB41C \uC870\uC9C1\uD654\uB85C \uAC00\uAE30\uC5D0\uB3C4 \uBA3C \uAC83 \uAC19\uACE0, \uC815\uCE58\uD654\uC5D0\uB294 \uAC00\uC9C0\uB3C4 \uBABB\uD560\uAC83\uC774\uB2E4. \uD0D3\uD558\uB824\uB294 \uAC74 \uC544\uB2C8\uACE0 \uADF8\uB0E5 \uADF8\uB807\uB2E4.",
