  "text" : "\uADF8\uB098\uC800\uB098 [\uAD6D\uAC00\uAC04 \uCD94\uACA9\uC758 \uACBD\uC81C\uD559] \uCC45 \uC804\uBC18\uC801\uC73C\uB85C \uD750\uB974\uB294 \uAE30\uC870\uB294 \uC88B\uC740\uB370, \uD544\uC790\uB4E4 \uC0AC\uC774 \uC218\uC900\uC774 \uB108\uBB34 \uCC28\uC774\uAC00 \uB9CE\uC774 \uB098\uC11C \uC9DC\uC99D\uC774 \uB09C\uB2E4. \uC774\uADFC \uC120\uC0DD\uACFC \uC8FC\uACBD\uCCA0 \uC120\uC0DD \uD074\uB77C\uC2A4\uAC00 \uC788\uAE30 \uB54C\uBB38\uC5D0 \uCC38\uC544\uC8FC\uBA74\uC11C \uC77D\uC744 \uC218 \uC788\uB294 \uB4EF. \uC8FC\uACBD\uCCA0 \uC120\uC0DD\uC740 \uC5B8\uC81C\uB098 \uC7A5\uC778 \uB290\uB08C\uC774 \uB09C\uB2E4.",
