  "text" : "\uC815\uB9AC\uD574\uBCF4\uC790\uBA74, \uBBFC\uC8FC\uC801 \uC2DC\uBBFC\uC73C\uB85C \uC0B4\uAE30 \uC704\uD55C \uD0DC\uB3C4\uB294 \uB193\uC9C0 \uC54A\uC744 \uAC83\uC774\uACE0 \uADF8 \uC548\uC5D0\uC11C \uC9C4\uBCF4\uC801 \uC785\uC7A5\uACFC \uBCF4\uC218\uC801 \uC785\uC7A5\uC774 \uAD50\uCC28\uD558\uBA74\uC11C \uC0B4\uAC8C \uB420 \uAC83\uC774\uB2E4. \uB2E4\uB978 \uD55C\uD3B8 \uBA39\uACE0 \uC0B4 \uC218 \uC788\uB294 \uB2A5\uB825, \uC544\uB80C\uD2B8 \uB9D0\uB9C8\uB530\uB098 '\uB178\uB3D9'\uACFC '\uC791\uC5C5'\uC5D0 \uBC1C\uD718\uD560 \uC9C0\uC2DD\uCCB4\uACC4, \uC4F8\uBAA8\uC788\uB294 \uC9C0\uC2DD\uB3C4 \uD544\uC694\uD558\uB2E4.",
