  "text" : "\uC138\uC0C1\uC744 \uC804\uBCF5\uD558\uAE30 \uC704\uD55C '\uBE44\uD310\uC758 \uBB34\uAE30'\uB97C \uBCBC\uB9AC\uACA0\uB2E4\uACE0 \uB9D1\uC2A4\uC8FC\uC758\uC640 \uC5EC\uC131\uC8FC\uC758, \uC0DD\uD0DC\uC8FC\uC758 \uB4F1 '\uAE09\uC9C4 \uC774\uB860'\uC744 \uC775\uD78C \uC2DC\uAC04\uC774 \uAD49\uC7A5\uD788 \uC18C\uC911\uD588\uC5C8\uB2E4. \uADFC\uB370 \uC9C0\uAE08 \uC77C\uD568\uC5D0 \uC788\uC5B4\uC11C \uD6A8\uC6A9\uC744 \uB192\uC77C \uC218 \uC788\uB294 \uAE30\uC220 \uB610\uB294 \uC9C0\uC2DD\uCCB4\uACC4\uB97C \uC5F0\uB9C8\uD588\uC73C\uBA74 \uC5B4\uB560\uB294\uAC00 \uD558\uB294 \uC9C8\uBB38\uC744 \uB193\uC744 \uC218\uB294 \uC5C6\uB2E4.",
