  "text" : "\uBE61 \uD558\uACE0 \uC624\uB294 \uB9D0\uC778\uB370, \uC0AC\uC2E4 \uC870\uB9AC\uB3CC\uB9AC\uAC70\uB098 \uC544\uB2C8\uBA74 \uC81C\uB85C\uC378\uC73C\uB85C \uD558\uB294 \uBC29\uC2DD\uC5D0 \uC775\uC219\uD558\uB2C8\u2026 \uADF8\uB798\uC11C \uC678\uACE8\uC218\uB4E4\uC5D0\uAC8C \uC870\uC9C1\uC0DD\uD65C\uC774 \uD544\uC694\uD55C \uAC83 \uAC19\uAE30\uB3C4 \uD558\uACE0.\n\u201C\uD611\uC0C1\uC740 \uC774\uAE30\uACE0 \uC9C0\uB294 \uAC8C\uC784\uC774 \uC544\uB2C8\uB2E4. \uAC70\uB798\uB97C \uD1B5\uD574 \uC11C\uB85C \uC6D0\uD558\uB294 \uAC83\uC744 \uC5BB\uB294 \uAC8C\uC784\uC774\uB2E4\u201D(\uD68C\uC7A5\uB2D8\uC758 \uAE00\uC4F0\uAE30, 231)",
