  "text" : "\u201C\uBD80\uC11C\uC774\uAE30\uC8FC\uC758\uB294 \uC18C\uD1B5 \uAC15\uD654\uB85C\uB3C4 \uD574\uACB0\uB418\uC9C0 \uC54A\uB294\uB2E4. \uBD80\uC11C \uAC04 \uC18C\uD1B5\uC774 \uC798 \uC774\uB8E8\uC5B4\uC9C0\uBA74 \uBD80\uC11C\uC774\uAE30\uC8FC\uC758\uAC00 \uD574\uACB0\uB420 \uAC83\uC774\uB77C\uB294 \uC0DD\uAC01\uC740 \uC548\uC77C\uD558\uB2E4. \uBD80\uC11C\uC774\uAE30\uC8FC\uC758\uB294 \uC18C\uD1B5 \uBB38\uC81C\uB97C \uAC00\uC838\uC628 \uC6D0\uC778\uC774\uB2E4. \uC18C\uD1B5\uC774 \uBD80\uC11C\uC774\uAE30\uC8FC\uC758\uC758 \uADFC\uC6D0\uC801\uC778 \uD574\uACB0\uCC45\uC740 \uB420 \uC218 \uC5C6\uB2E4\u201D(\uD68C\uC7A5\uB2D8\uC758 \uAE00\uC4F0\uAE30, 151)",
